    "require(caret)\n",
    "\n",
    "set.seed(12345)\n",
    "\n",
    "train_data = train_data[sample(nrow(train_data)),]\n",
    "\n",
    "folds <- cut(seq(1, nrow(train_data)), breaks = 10, labels = FALSE)\n",
    "\n",
    "my.indices <- vector('list',10)\n",
    "\n",
    "    for(i in 1:10){\n",
    "        my.indices[[i]] <- which(folds!=i)\n",
    "    }\n",
    "      \n",
    "cv <- trainControl(method = \"cv\",\n",
    "                   index  = my.indices)"
   ]
